/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="11" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><table border="0" cellspacing="0" cellpadding="0" width="100%"><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/tlt_service.jpg" width="100%"></td></tr><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr><tr><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/btn_service01.jpg" width="100%"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><br><br>■無水だから、素材本来のおいしさも、栄養もまるごと調理<br>■自動調理だから、“むずかしい”や“めんどう”が、おまかせでラクラク!<br>■操作やお手入れもカンタン!保温はもちろん、あたため直しもワンキーで!<br><b>電源</b>：交流100V 50-60Hz 共用<br><b>定格消費電力</b>：600W<br><b>定格容量</b>：1.6L<br><b>設定温度(発酵)</b>：35～65℃<br><b>最大予約調理時間</b>：12時間<br><b>電源コードの長さ</b>：約1.8m(マグネットプラグ方式)<br><b>メニュー集掲載数</b>：100(自動メニュー85/手動メニュー15)<br><b>寸法</b>：幅 364x高さ 224x奥行 280mm<br><b>質量</b>：約5.2kg<br><b>付属品</b>：<br>　蒸し板<br>　保存専用ふた<br>　メニュー集<br>　メニューガイド<br>　取扱説明書<br><style type="text/css">
/*買い物カゴボタン*/
