br><b>電源</b>：AC100V 50-60Hz<br><b>定格消費電力</b>：800W<br><b>定格容量</b>：2.4L<br><b>設定温度(発酵)</b>：35～90℃<br><b>最大予約設定時間</b>：12時間<br><b>電源コードの長さ</b>：約1.8m(マグネットプラグ方式)<br><b>メニュー集掲載数</b>：143(自動メニュー119/手動メニュー24)<br><b>メーカー保証</b>：1年<br><b>寸法</b>：幅 395x高さ 240x奥行 305mm<br><b>質量</b>：約6.1kg<br><style type="text/css">
